import Web3 from 'web3/dist/web3.min.js'

export async function ConnectWallet() {
	try {
		if (window.ethereum) {
			let web3 = new Web3(window.ethereum)
			await window.ethereum
		}
	} catch (error) {
		console.log(`Something went wrong`)
	}
}
